import React, { Component } from 'react';
import { HashRouter, Route, Switch } from 'react-router-dom';
import Signup from "./containers/Signup";


class App extends Component {
  render() {
    return (
      <HashRouter>
            <Switch>
              <Route path="/signup" component={Signup} />
            </Switch>
      </HashRouter>
    );
  }
}

export default App;
